import Home from './Components/Home';
import Auth from './Components/Auth';

import { BrowserRouter, Routes, Link, Route } from 'react-router-dom';
import { Nav } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';


function App() {
  return (

    <div  className="App">
      <h1>Aplicação desenvolvida para disciplina de TACs</h1>
      <p>Aluno: Douglas Oliveira Marcondes Cardoso - 2043351</p>
      <p>Professor: Ricardo Sobjak</p>
      <p>Tecnologias utilizadas:</p>
        <li>Spring Boot</li>
        <li>Node.Js</li>
        <li>Postgres</li>
        <li>MongoDb</li>
        <li>React</li>
      <BrowserRouter>
      <Nav variant="tabs">
        <Nav.Link as={Link} to="/">Página inicial</Nav.Link>
        <Nav.Link as={Link} to="/auth">Login</Nav.Link>

      </Nav>

      <Routes>
        <Route path="/" element={<Home></Home>}></Route>
        <Route path="/alunos" element={<Auth></Auth>}></Route>

      </Routes>

      </BrowserRouter>



    </div>
  );
}

export default App;
